                <span>推荐作者</span>
                <button className="button"><i className="iconfont">&#xe626;</i> 换一批</button>
            </AuthorTop>
            <AuthorBottom>

            </AuthorBottom>
        </AuthorWrap>
    )
}
export default connect(null, null)(Author)
